import cl from './Dialogs.module.css';
import {NavLink} from "react-router-dom";
import React, {useState} from "react";

const DialogItem = (props) => {

    const path = '/DIALOGS/' + props.id

    return <div className={cl.item}>
        <NavLink to={path} className={onActive}>{props.name}</NavLink></div>

}

const DialogMessage = (props) => {

   return <div className={cl.message}>{props.message}</div>
}

const onActive = ({isActive}) => isActive ? `${cl.active}` : ''

export const Dialogs = () => {


    return (
        <div className={cl.dialogs}>
            <div className={cl.dialogsItems}>
                <DialogItem name={'Vatsok'} id={':DIALOG1'}/>
                <DialogItem name={'Goshan'} id={':DIALOG2'}/>
                <DialogItem name={'Ivan'} id={':DIALOG3'}/>
                <DialogItem name={'Dre'} id={':DIALOG4'}/>
                {/*<div className={cl.item}><NavLink to={'/DIALOGS/:DIALOG1'} className={onActive}>Vasyan</NavLink></div>*/}
            </div>

            <div className={cl.messages}>
                <DialogMessage message={'Hi'}/>
                <DialogMessage message={'yo!'}/>
                <DialogMessage message={'A'}/>
            </div>
        </div>
    )
}
